import React from 'react';
import {
  AppBar, IconButton, Toolbar, Typography,
} from '@mui/material';

export default function Navbar() {
  return (
    <AppBar position="static">
      <Toolbar>
        <Typography variant="h6" component="div" sx={{flexGrow: 1}}>
          Penn Buddy
        </Typography>
      </Toolbar>
    </AppBar>
  );
}

